import React from 'react';
import { Redirect } from 'react-router-dom';
function HomePageItem(props) {
  console.log(props.items)
  function handleClick(e) { 
    e.preventDefault();  
    console.log('Kliknięto w link.'); 
  }
  return (
    <div className="home__suggestions__first" onClick={handleClick}>
        <img className="home__suggestions__first__img" src={props.items.images[0].original}></img>
        <h1>{props.items.title}</h1>
        <h1>OPis</h1>
        <h1>{props.items.description}</h1>
    </div>
  )
}
export default HomePageItem;
